import "./footer.css";

const Footer = () => {
  return (
    <div className="footer">
      <div className="fLists">
        <ul className="fList">

          <li className="fListItem">Tooted</li>
        </ul>
        <ul className="fList">
          <li className="fListItem">Esemed </li>

        </ul>

        <ul className="fList">

          <li className="fListItem">Tingimused</li>
        </ul>
      </div>
      <div className="fText"></div>
    </div>
  );
};

export default Footer;
